        timeofday = 'Its noon'

    }
    else {
        timeofday = "Its morning"
    }
    if (hours > 18) {
        timeofday = "Its after noon"

    }


    return (
        <div>
            <Header2 />
            <h1> {hours}:{minutes} {timeofday}</h1>


        </div>
    )

}
